import React from "react";
import Contract from "./Contract";
import "./styles/Contracts.css";
import "./styles/GridLayout.css";

const renderContracts = props => {
  return (
      <React.Fragment>
      {props.contracts.map(con => {
        return  <Contract className="col-4"
            name={con.name}
            startDate={con.startDate}
            endDate={con.endDate}
            price={con.price}
          />
        
      })}
      </React.Fragment>
  );
};

const ContractContainer = props => (
  <div className="contractContainer">{renderContracts()};</div>
);

export default ContractContainer;
